import React from 'react';
import '../styles/dashboard.css';

const Dashboard = () => {
  return (
    <main className="container center" aria-labelledby="dashboard-title">
      
      <h1>Clean Energy Progress in the United States</h1>
      <p>The United States has seen significant growth in clean energy over the past decade, with solar and wind power leading the charge. In 2023, America's capacity to generate carbon-free electricity grew, driven by a 23% increase in solar capacity and a 16% increase in solar electricity generation compared to 2022.</p>

      <h2>Solar Energy Highlights</h2>
      <ul>
        <li>The U.S. produced 238,121 gigawatt-hours (GWh) of electricity from solar in 2023, more than eight times the amount generated a decade earlier.</li>
        <li>California and Texas led the nation in solar power generation, with California producing 68,816 GWh and Texas producing 31,739 GWh.</li>
        <li>Small-scale solar installations accounted for 34% of all solar capacity in the U.S. at the end of 2023, with nearly 8 GW of new capacity brought online.</li>
      </ul>

      <h2>Key Trends</h2>
      <ul>
        <li>Solar capacity has grown by 688% over the past decade, with an increase of 121 GW.</li>
        <li>Utility-scale solar accounts for around 8% of the nation's capacity from all utility-scale electricity sources.</li>
        <li>Nevada's Gemini solar facility is expected to come online in 2024, adding 690 MW of solar capacity and 380 MW of battery storage.</li>
      </ul>

      <p>These developments demonstrate the nation's progress toward net-zero carbon emissions targets and underscore the importance of solar energy in the U.S. clean energy mix.</p>

      <h2>Project Technical Aspects</h2>
      <p>Your description of the tech stack and infrastructure here...</p>

      <footer className="footer" role="contentinfo">
        &copy; 2023 Clean Energy Innovations Dashboard
      </footer>
    </main>
  );
};

export default Dashboard;
